  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains polygons delineating
  the seamline boundaries of imagery acquired as part of the National Agriculture
  Imagery Program (NAIP), and used in the creation of DOQQs and compressed county
  mosaics (CCM). These seam polygons can be used as a tool in determining the image
  source and date of each portion of the DOQQ or the CCM. The NAIP acquires 4 band
  digital ortho imagery from airborne and/or space based platforms during the agricultural
  growing seasons in the U.S.. A primary goal of the NAIP program is to enable availability
  of ortho imagery within sixty days of acquisition. The NAIP provides 1 meter GSD
  ortho imagery rectified within +/- 6 meters to true ground at a 95% confidence level.
  The tiling format of NAIP imagery is based on a 3.75' x 3.75' quarter quadrangle
  with a 300 (plus or minus 30) pixel buffer on all four sides. The NAIP quarter quads
  are formatted to the UTM coordinate system using the North American Datum of 1983
  (NAD83).\",\n\t\"owner_org\": \"b0b4c45b-a8ca-416b-b463-ee90d0a1a3df\",\n\t\"extras\":
